import React from 'react';

 const AccountDetails = (props) => {
    const {username, total_games, total_wins, total_kills} = props;

    postData(() => {
        alert('hi');
    })

    return (
        <div>
            <h2>{username}</h2>
            <h4>Games: {total_games}</h4>
            <h4>Wins: {total_wins}</h4>
            <h4>Kills: {total_kills}</h4>

            <button onClick={ () => this.postData()}>press for data</button>
        </div>
    )
}

export default AccountDetails;
